CREATE EXTENSION IF NOT EXISTS "uuid-ossp";
CREATE EXTENSION IF NOT EXISTS postgis;
-- Verify
SELECT PostGIS_Full_Version();

CREATE TABLE public.litter_bin_type
(
    type_uuid uuid NOT NULL DEFAULT uuid_generate_v4(),
    designation character varying(255) COLLATE pg_catalog."default" NOT NULL,
    price numeric(7,2),
    volume integer NOT NULL,
    CONSTRAINT litter_bin_type_pkey PRIMARY KEY (type_uuid)
);



-- Added by ME (Y.S) to prevent error of TABLE liter_bin_geoposition
CREATE SEQUENCE abfall_sp_abfallkuebel_id_nr_seq
START WITH 1
INCREMENT BY 1
NO MINVALUE
NO MAXVALUE
CACHE 1;




CREATE TABLE public.litter_bin_geoposition
(
    litter_bin_uuid uuid NOT NULL DEFAULT uuid_generate_v4(),
    geom_point geometry(Point,2056) NOT NULL,
    fk_type_uuid uuid NOT NULL,
    archive boolean DEFAULT false,
    creation_date date DEFAULT now(),
    end_date date,
    active boolean DEFAULT true,
    fastnacht smallint DEFAULT 0,
    braderie smallint DEFAULT 0,
    christmas_market smallint DEFAULT 0,
    barbecue_season smallint DEFAULT 0,
    bin_full boolean DEFAULT false,
    robidog_empty boolean DEFAULT false,
    ashtray_full boolean DEFAULT false,
    defect boolean DEFAULT false,
    dirty boolean DEFAULT false,
    id_nr integer NOT NULL DEFAULT nextval('abfall_sp_abfallkuebel_id_nr_seq'::regclass),
    CONSTRAINT litter_bin_geoposition_pkey PRIMARY KEY (litter_bin_uuid),
    CONSTRAINT litter_bin_geoposition_fkey FOREIGN KEY (fk_type_uuid)
        REFERENCES public.litter_bin_type (type_uuid) MATCH SIMPLE
        ON UPDATE CASCADE
        ON DELETE CASCADE
);


-- Index: sidx_litter_bin_geoposition_geompoint
CREATE INDEX sidx_litter_bin_geoposition_geompoint
    ON public.litter_bin_geoposition (geom_point)
    TABLESPACE pg_default;

CREATE TYPE notification_types AS ENUM ('emptied', 'full', 'dirty', 'cleaned', 'broken', 'fixed', 'robidog_empty', 'robidog_refilled', 'ashtray_full', 'ashtray_emptied');

CREATE TABLE public.bin_state_notification
(
    state_uuid uuid NOT NULL DEFAULT uuid_generate_v4(),
    litter_bin_uuid uuid NOT NULL,
    point_in_time timestamp with time zone DEFAULT now(),
    notification_type notification_types,
    volume integer,
    CONSTRAINT bin_state_notification_pkey PRIMARY KEY (state_uuid),
    CONSTRAINT bin_state_notification_fkey FOREIGN KEY (litter_bin_uuid)
        REFERENCES public.litter_bin_geoposition (litter_bin_uuid) MATCH SIMPLE
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE INDEX sidx_bin_state_notification_notification_type
    ON public.bin_state_notification (notification_type)
    TABLESPACE pg_default;

CREATE INDEX sidx_bin_state_notification_point_in_time
    ON public.bin_state_notification (point_in_time)
    TABLESPACE pg_default;







